  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113585 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the Labrador
  Sea and North Atlantic Ocean from 1999-07-11 to 1999-08-10 and retrieved during
  cruise 06MT19990711 (06MT199907 and 06MT453). These data include CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect
  these data include CTD and bottle. These data were collected by K. Friis of Commonwealth
  Scientific and Industrial Research Organization and F. Schott [affiliation unknown]
  as part of the CARINA/06MT19990711 data set.nnThe CARINA (CARbon dioxide IN the
  Atlantic Ocean) data synthesis project is an international collaborative effort
  of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
